Приложение Красное&Белое — одна маленькая иконка, а столько полезных функций! Регистрируйся в удобном личном кабинете и ты сможешь:

• Узнать стоимость любого товара;
• Узнать об акциях и скидках;
• Определить местонахождение ближайшего магазина;
• Найти нужный товар, ознакомиться с его описанием и рейтингом;
• Проверить напитки на легальность по коду в чеке;
• Привязать дисконтную карту к смартфону и получать скидку;

Мобильное приложение Красное&Белое носит информационный характер. Предназначено только для предоставления сведений о наличии товаров в магазинах и их бронировании, не предусматривает возможности покупки и доставки товаров. Предназначено для лиц, достигших 18-летнего возраста.

"Magnit delivery" is an application for home delivery of groceries from Magnit. For residents of Moscow and Krasnodar. Magnit is now at your home!

In the application:
• no more heavy packages – we will bring purchases directly to the door and hand them over without contact;
• we will select goods as for ourselves. And if something is out of stock – we will offer a worthy replacement!

In the new application "Magnit Delivery" you can:
• order groceries from 5,000 names with home delivery in Moscow and 25,000 names with home delivery in Krasnodar
• pay for the order by card in the application;
• register and store order history;
• receive push notifications with order status;
Also you can set up notifications, read privacy policies and contact support in personal account.

Delivery terms in Moscow:
• within 60 minutes within the MKAD;
• daily from 8:00 to 22:00;
• delivery cost from 49 rubles and free for orders over 999 rubles;
• weight limit – 30 kg.

Delivery terms in Krasnodar:
• after 3 hours at the same day, or at 60 min time interval 
• daily from 10:00 to 22:00;
• minimum order amount is 500 rubles;
• delivery cost 199 rubles and free for orders over 3000 rubles; 
• weight limit – 50kg.

С SimpleWine вы сможете найти «то самое вино»! Мы ценим своих клиентов и гарантируем подлинность всего ассортимента.

Портфель Simple составляют российские эксперты, выбирая лучшее из сотен тысяч предложений. В SimpleWine можно быстро и легко найти вино или любой другой напиток независимо от поводов и предпочтений. 

В приложении вам доступно:
— быстрый выбор напитков для любого случая с помощью удобных фильтров в каталоге и готовых подборок;
— использование сканера штрихкодов для поиска в каталоге;
— простое оформление заказа; 
— консультации в чате с менеджером;
— отслеживание истории заказов и добавление полюбившихся товаров в избранное.

Преимущества приложения SimpleWine:
— каталог состоит из более 7000 наименований вин Старого и Нового Света, крепких и безалкогольных напитков и аксессуаров;
— актуальная информация обо всех новинках, акциях и специальных предложениях;
— интерактивная карта с адресами более 70 винотек в Москве, Санкт-Петербурге, Обнинске, Смоленске, Ростове-на-Дону, Самаре, Калуге, Сочи, Краснодаре, Ижевске и Наро-Фоминске;
— информация об интересных мероприятиях в винотеках: дегустациях, курсах и мастер-классах;
— привилегии программы лояльности: бонусы за покупки, оплату бонусами до 50% стоимости покупок, увеличение постоянной скидки, а также скидка на день рождения и другие.

Реферальная программа в SimpleWine
1. Заказывайте алкоголь в нашем интернет-магазине.
2. Копируйте индивидуальную ссылку в личном кабинете в разделе «Приведи друга» и отправляйте друзьям.
3. Получайте 1000 бонусов, как только приглашенный друг зарегистрируется и сделает первый заказ в приложении.

Мобильное приложение содержит информацию, не рекомендованную для лиц, не достигших совершеннолетия. Размещенные здесь сведения носят исключительно информационный характер и предназначены только для личного использования.

Новое мобильное приложение «Шоколадницы» — это единая программа лояльности для всех заведений сети. С его помощью вы сможете без труда найти ближайшее кафе, узнать о действующих акциях и специальных предложениях.

Что дает участие в программе лояльности:

- бонусы за каждый заказ, которыми можно оплачивать следующие покупки (до 50% от суммы чека);
- кэшбек 10%;
- кофе (размера S) в подарок после первой покупки;
- 200 бонусов в подарок за 5 дней до дня рождения;
- «штампики»: каждый 10-й кофе, завтрак, ланч и ужин — бесплатно;
- персональные акции: пуш-уведомления с выгодными предложениями;
- абонементы и подарочные карты, которые можно приобрести в приложении и подарить в электронном виде.

